//     <div className="popup whiteSound_popup">
//       <button className="exit"></button>
//       <WhiteSoundBox />
//     </div>
//   );
// };

export const WhiteSoundBox = () => {
  return (
    <>
      <button className="exit"></button>
      <div className="whiteSound_popup">
        <div className="whiteSoundBox"></div>
        <div className="whiteSoundBox"></div>
        <div className="whiteSoundBox"></div>
        <div className="whiteSoundBox"></div>
        <div className="whiteSoundBox"></div>
        <div className="whiteSoundBox"></div>
      </div>
    </>
  );
};

const WhiteSound = {
  WhiteSoundButton,
  WhiteSoundPopup,
  WhiteSoundBox,
};

export default WhiteSound;
